Building upon the example in the previous section, lets add 2 more clients: a random generator struct RandGen { data: Vec<i32>,
}
impl RandGen { pub fn new(n_sample: usize) -> Self { let mut data = vec![0i32; n_sample]; let mut rng = WyRand::new(); rng.fill(&mut data); Self { data } }
}
impl Update for RandGen {}
impl Write<In> for RandGen { fn write(&mut self) -> Option<Data<In>> { self.data.pop().map(|val| Data::new(val)) }
} a data logger #[derive(Default)]
struct DataLogger { data: Vec<f32>,
}
impl Update for DataLogger {}
impl Read<Out> for DataLogger { fn read(&mut self, data: Data<Out>) { self.data.push(*data); }
} With all the clients defined with an actor/client interface, the actors are instanciated with let mut source = Initiator::<_>::from(RandGen::new(1_000_000)); let mut filter = Actor::<_>::from(Client::default()); let mut log = Terminator::<_>::from(DataLogger::default()); Each actor requires 3 generic type parameters: the client type and 2 constants: the inputs and outputs sampling rates. The inputs rate is zero if the actor has no inputs and the outputs rate is zero if the actor has no outputs. The default sampling rate for inputs and outputs is 1. The next step is to build the network. The links between actors are established by successively creating channels between an actor output and the input of another actor, both the output and the input must have been given the same type and the same sampling rate. source.add_output().build::<In>().into_input(&mut filter)?; filter .add_output() .unbounded() .build::<Out>() .into_input(&mut log)?; Now the model can be assembled, charted, checked for errors and run: model!(source, filter, log) .flowchart() .check()? .run() .await?; Integrated Model The model stop itself when the data from the RandGen client is exhausted. By setting a logger at the begining of the main application, insight into the behavior of the model can be gathered. For example, setting the env_logger crate with env_logger::builder() .format_timestamp(None) .format_target(false) .init(); and running the application with the RUST_LOG environment variable: RUST_LOG=warn cargo run ... outputs the following: Warning Setting RUST_LOG to info instead gives RUST_LOG=info cargo run ... Warning and with RUST_LOG=debug cargo run ... Warning Debug information is displayed only for application run in debug mode.

